window.bookSummaryJSON = "<p>On the eve of the winter solstice, Tokara rushes out into the snowy woods to find her sister's lost puppy. Her daring path takes her far beyond the protection of her mother's castle and brings her face-to-face with a mystery older than the stars. But our girl has a brave heart and an irrepressible spirit, and the longest night of the year still holds many secrets.&nbsp;&nbsp;</p> <p>Travel to another corner of the world OF CATS AND DRAGONS.</p>"; 
